import ImageGallery from 'react-image-gallery';
import "../node_modules/react-image-gallery/styles/css/image-gallery.css";

import './Home.css';

const images = [
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img003.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img003.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img014.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img014.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img005.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img005.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img011.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img011.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img021.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img021.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img026.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img026.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img029.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img029.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img028.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img028.jpg',
  },
  {
    original: 'https://themellowyellowmedia.b-cdn.net/img029.jpg',
    thumbnail: 'https://themellowyellowmedia.b-cdn.net/img029.jpg',
  },
];

class Home extends React.Component { 

  constructor() {
    super();
    this.state = { 

    };

  }

  componentDidMount()
  {

  }




  render()
  {  
    return (
      <div className="pageContainer">
        <div>
          <center>
            <br></br>
            <img src='https://themellowyellowmedia.b-cdn.net/cover.png' className='logo'></img>
            <br></br>
            <br></br>
            <img src='https://themellowyellowmedia.b-cdn.net/thumbnail.png' className='cover'></img>
            <br></br>

            <div className='socialContainer'>



            <a href="https://music.apple.com/us/artist/zl-ster/1544086565" target="_blank"><img src="https://themellowyellowmedia.b-cdn.net/apple_music.png" className='social'></img></a>
              &nbsp;


              <a href="https://open.spotify.com/artist/5q70XbWzSCjlnxUstVSYzw" target="_blank"><img src="https://themellowyellowmedia.b-cdn.net/spotify.png" className='social'></img></a>


            </div>
            <br></br>

            <img src="https://themellowyellowmedia.b-cdn.net/cloud_man_2.png" className='asset'></img>
            <br></br>
            <br></br>

            <div
              className="video"
              style={{
                position: "relative",
                paddingBottom: "56.25%" /* 16:9 */,
                paddingTop: 25,
                height: 0,

              }}
            >
              <center>
                  <iframe
                    style={{
                      position: "absolute",
                      top: '50%',
                      left: '50%',
                      width: "80%",
                      height: "80%",
                      border: '.5em solid yellow',
                      alignSelf: 'center',

                      transform: 'translate(-50%, -50%)'
                    }}
                    src={`https://www.youtube.com/embed/ZNXhjrj7byY`}
                    frameBorder="0"
                  />

                </center>

            </div>
          <br></br>
            <img src="https://themellowyellowmedia.b-cdn.net/meditate_2.png" className='asset'></img>
            <br></br>
            <br></br>
            <ImageGallery items={images} />;
          </center>
        </div>





    </div>

    )




  }
}
export default Home;
